import React from 'react';
import {timeConverter} from '../converter/converter'

function hourlyWeather(props){
  const {data} = props;

  return(
    <React.Fragment>
    <p>{timeConverter(data[0].dt)}</p>
    <p>{timeConverter(data[1].dt)}</p>
    </React.Fragment>
  )
}

export default hourlyWeather;
